import Button from "../utils/Button";
import { useHistory } from "react-router-dom";

export default function IndexGenres() {

    const history = useHistory();

    return (
        <>
            <h3>Genres Test</h3>

            <Button onclick={() => {
            //saving in database

                history.push('/genres');
            }}>Save Changes</Button>

        </>
    )
}
